    [],nt"revision_timestamp": "2016-01-07T13:53:00.104821",nt"name": "monitoring-emperor-goose-populations-by-aerial-counts-and-fall-age-ratio",nt"isopen":
    false,nt"url": null,nt"notes": "In 1995, we photographed flocks of emperor
    geese Chen canagica during fall migration at lagoons along the north side of the
    Alaska Peninsula for the 11th consecutive year. The gray head plumage of juvenile
    geese differed from the uniform white heads of older geese. Cluster sampling by
    photographs within each lagoon and stratified sampling among lagoons provided unbiased
    estimates of age ratio for the entire population. The number of geese counted at
    each lagoon during an independent aerial shoreline survey detennined the strata
    weights. Annual estimation of age ratio and total fall population size were used
    to monitor annual production, population size, and estimate average survival rate.Averaging
    from 19851995, 22.4 of the fall emperor goose population were firstyear birds; the
    age ratio ranged from 2226 except for 1985 and 1992 with 1516 young. Total population
    size increased from 1985 to 1995 at a average annual rate of 1.065 and the combinedage,
    annual survival rate averaged 0.820.",nt"license_title": "License Not Specified",nt"extras":
